import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { motion, AnimatePresence } from 'framer-motion';

function PropertyCard({ property, featured = false }) {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [isLiked, setIsLiked] = useState(false);

  const formatPrice = (price) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
      minimumFractionDigits: 0,
      maximumFractionDigits: 0,
    }).format(price);
  };

  const formatSquareFeet = (sqft) => {
    return new Intl.NumberFormat('en-US').format(sqft);
  };

  const nextImage = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setCurrentImageIndex((prev) => 
      prev === property.images.length - 1 ? 0 : prev + 1
    );
  };

  const prevImage = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setCurrentImageIndex((prev) => 
      prev === 0 ? property.images.length - 1 : prev - 1
    );
  };

  const toggleLike = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setIsLiked(!isLiked);
  };

  return (
    <article className={`card card--property ${featured ? 'card--featured' : ''}`}>
      <div className="card__image">
        <img
          src={property.images[currentImageIndex]}
          alt={`${property.address} - Image ${currentImageIndex + 1} of ${property.images.length}`}
          loading="lazy"
        />

        <div className="card__image-overlay"></div>

        {property.status && (
          <div className={`card__image-badge ${
            property.status === 'Active' ? '' : 
            property.status === 'Pending' ? 'card__image-badge--warning' :
            property.status === 'Sold' ? 'card__image-badge--error' : ''
          }`}>
            {property.status}
          </div>
        )}

        <div className="card__image-actions">
          <button
            className="btn btn--icon"
            onClick={toggleLike}
            aria-label={isLiked ? 'Remove from favorites' : 'Add to favorites'}
          >
            <i className={`${isLiked ? 'fas' : 'far'} fa-heart`} aria-hidden="true"></i>
          </button>
          <button
            className="btn btn--icon"
            aria-label="Share property"
          >
            <i className="fas fa-share-alt" aria-hidden="true"></i>
          </button>
        </div>

        {property.images.length > 1 && (
          <>
            <button
              className="card__nav card__nav--prev"
              onClick={prevImage}
              aria-label="Previous image"
            >
              <i className="fas fa-chevron-left" aria-hidden="true"></i>
            </button>
            <button
              className="card__nav card__nav--next"
              onClick={nextImage}
              aria-label="Next image"
            >
              <i className="fas fa-chevron-right" aria-hidden="true"></i>
            </button>

            <div className="card__image-indicators">
              {property.images.map((_, index) => (
                <button
                  key={index}
                  className={`indicator ${index === currentImageIndex ? 'active' : ''}`}
                  onClick={(e) => {
                    e.preventDefault();
                    e.stopPropagation();
                    setCurrentImageIndex(index);
                  }}
                  aria-label={`View image ${index + 1}`}
                ></button>
              ))}
            </div>
          </>
        )}
      </div>

      <div className="card__content">
        <div className="card__price">
          {formatPrice(property.price)}
        </div>

        <div className="card__address">
          <i className="fas fa-map-marker-alt" aria-hidden="true"></i>
          {property.address}
        </div>

        <div className="card__features">
          <div className="card__features-item">
            <i className="fas fa-bed" aria-hidden="true"></i>
            <span className="value">{property.bedrooms}</span>
            <span>bed{property.bedrooms !== 1 ? 's' : ''}</span>
          </div>
          <div className="card__features-item">
            <i className="fas fa-bath" aria-hidden="true"></i>
            <span className="value">{property.bathrooms}</span>
            <span>bath{property.bathrooms !== 1 ? 's' : ''}</span>
          </div>
          <div className="card__features-item">
            <i className="fas fa-ruler-combined" aria-hidden="true"></i>
            <span className="value">{formatSquareFeet(property.squareFeet)}</span>
            <span>sqft</span>
          </div>
        </div>

        {property.description && (
          <p className="card__text">
            {property.description.length > 120 
              ? `${property.description.substring(0, 120)}...` 
              : property.description
            }
          </p>
        )}

        <div className="card__footer">
          <div className="card__mls">
            MLS # {property.mlsNumber}
          </div>

          <Link
            to={`/properties/${property.id}`}
            className="btn btn--primary btn--sm"
            aria-label={`View details for ${property.address}`}
          >
            View Details
          </Link>
        </div>
      </div>
    </article>
  );
}

export default PropertyCard;
